import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import "./App.css";
import HomePage from "./HomePage";
import FeedPage from "./FeedPage";

function App() {
  return (
    <BrowserRouter>
      <div>
        <Switch>
          <Route exact path="/">
            <HomePage />
          </Route>
          <Route path="/feed" component={FeedPage} />
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
